import React, { useState } from "react";
import "../css/hover-menu-items-shape.css";

import { ButtonComponent } from "./ButtonComponent";
import Arrow from "../ShapeForms/Arrow.png";
import Circle from "../ShapeForms/Circle.png";
import Line from "../ShapeForms/Line.png";
import Rectangle from "../ShapeForms/Rectangle.png";
import Dash_Arrow from "../ShapeForms/Dash_Arrow.png";
import Dash_Circle from "../ShapeForms/Dash_Circle.png";
import Dash_Line from "../ShapeForms/Dash_Line.png";
import Dash_Rectangle from "../ShapeForms/Dash_Rectangle.png";

export const HoverMenuItems_Shapes = () => {
  const shapes = [
    {
      name: "Arrow",
      bgImg: Arrow,
      whatItDoes: () => {
        console.log("Arrow");
      },
    },
    {
      name: "Rectangle",
      bgImg: Rectangle,
      whatItDoes: () => {
        console.log("Rectangle");
      },
    },
    {
      name: "Line",
      bgImg: Line,
      whatItDoes: () => {
        console.log("Line");
      },
    },
    {
      name: "Circle",
      bgImg: Circle,
      whatItDoes: () => {
        console.log("Circle");
      },
    },
    {
      name: "DashedArrow",
      bgImg: Dash_Arrow,
      whatItDoes: () => {
        console.log("DashedRectangle");
      },
    },
    { name: "DashedRectangle", bgImg: Dash_Rectangle, whatItDoes: () => {} },
    { name: "DashedLine", bgImg: Dash_Line, whatItDoes: () => {} },
    { name: "DashedCircle", bgImg: Dash_Circle, whatItDoes: () => {} },
  ];
  return (
    <div className="container">
      {shapes.map((item, _) => (
        <button
          onMouseDown={() => {
            item.whatItDoes();
          }}
        >
          <img src={item.bgImg}></img>
        </button>
      ))}
    </div>
  );
};
